import React from 'react';
import useFetch from './FechData';
import Sidebar from './electronics/Sidebar';
import Feed from './electronics/Feed';
import {Stack,Box} from '@mui/system';
import Navbar from './Navbar';
import { useState } from 'react';
import {ListItem,List} from '@mui/material';
const Electronics = () => {
   const {data,isPending,error}=useFetch("");
   const [pes,setpase]=useState([{id:1},{id:2},{id:3},{id:4},{id:5}]);

   return ( 
      <>
      <Navbar />
      <div>
      <Stack direction="row"  justifyContent="space-between" spacing={0.5}>
         <Sidebar />
         <Box flex={7} 
   >
      <Box sx={{
      position:"absolute",
      top:"68px",
      width:"100%",
      backgroundColor:"green",
    }}>
      <List >
      {
      pes.forEach((value)=>{
        <ListItem key={value.id}>
          <p> the value is  {value} </p>
         {/* <Box key={value}  sx={{
            position:"relative",
            marginRight:"10px",
            backgroundColor:"yellow",
            height:"100px",
            width:"100px",
            display:"inline-block"

      }}>hello1</Box> */}
      </ListItem>
      })
      
      }
      </List>
  
      </Box>
      </Box>
      </Stack>
      </div>
      </>
     );
}
export default Electronics;
